import React from "react";

const About: React.FC = () => {
  return (
    <section id="about" className="py-20">
      <div className="container mx-auto px-4 text-center">
        <h3 className="text-3xl font-semibold mb-6">About Us</h3>
        <p className="max-w-3xl mx-auto text-gray-700">
          ProService Co. has been providing innovative business and technology solutions
          since 2010. Our mission is to help clients succeed through high-quality services
          and expert consultation.
        </p>
      </div>
    </section>
  );
};

export default About;
